import { buttonComponentText, projectsComponentImage } from '../../utils/arrays';
import ButtonComponent from '../ButtonComponent/ButtonComponent';
import ProjectsComponent from '../ProjectsComponent/ProjectsComponents';
import './Works.css';

export default function Works() {
    return (
        <section className='works'>
            <h2 className='works__title'>
                Наши проекты
            </h2>
            <p className='works__description'>
                Секция “Наши проекты” включает в себя список реализованных компанией проектов, каждый из которых имеет название, описание, дату реализации и ссылку на сайт или портфолио для получения более подробной информации.
            </p>
            <div className='works__projects'>
                {
                    projectsComponentImage.map((img) => (
                        <ProjectsComponent key={img.image} {...img} />))
                }
            </div>
            <ButtonComponent {...buttonComponentText[2]} />
        </section>
    )
}
